import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import logo from "../assets/img/Imagen3.png";

class Menu extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    
    render() { 

        function setTitle(){
            if(window.location.pathname === "/funcionario"){
                localStorage.setItem('titulo',"Dashboard")
            }else if(window.location.pathname === "/concecutivo"){
                // localStorage.setItem('titulo',"Crear concecutivo")
            }
        }
        return ( 
            <>
                <div className="col-1 menu">
                    <img src={logo} alt="" width="100%"/>
                    <nav className="navbar row text-center">
                        <Link className="nav-link link fs-4 text-black" to="/funcionario" onclick={setTitle()}>
                        Dashboard
                        </Link>
                        <Link className="nav-link link fs-4 text-black" to="/concecutivo" onclick={setTitle()}> 
                        {this.props.opcion}
                        </Link>
                    </nav>
                </div>
            </>
        );
    }
}
export default Menu;
